  @BeforeEach
  public void beforeEach() {
    Properties properties = new Properties();
    properties.put("woa_s1.netcdf.uri", "https://data.nodc.noaa.gov/woa/WOA18/DATA/temperature/netcdf/decav/5deg/woa18_decav_t13_5d.nc");
    properties.put("woa_s2.netcdf.uri", "https://data.nodc.noaa.gov/woa/WOA18/DATA/temperature/netcdf/decav/5deg/woa18_decav_t14_5d.nc");
    properties.put("woa_s3.netcdf.uri", "https://data.nodc.noaa.gov/woa/WOA18/DATA/temperature/netcdf/decav/5deg/woa18_decav_t15_5d.nc");
    properties.put("woa_s4.netcdf.uri", "https://data.nodc.noaa.gov/woa/WOA18/DATA/temperature/netcdf/decav/5deg/woa18_decav_t16_5d.nc");
    properties.put(CarsParametersReader.CARS_NC_PROP, "https://auto-qc-data.s3.us-west-2.amazonaws.com/temperature_cars2009a.nc");
    properties.put("data.dir", "../../test-data");

    woaParameters = WoaParametersReader.loadParameters(properties);
    carsParameters = CarsParametersReader.loadParameters(properties);
  }

  @Test
  void testComputeAnomaly() throws InvalidRangeException, IOException {
    assertArrayEquals(
        EXPECTED_COMBINED_PROBABILITIES,
        CoTeDeAnomalyDetection.computeAnomaly(
            CoTeDeGradient.computeGradient(TEMPERATURES),
            CoTeDeSpike.computeSpikes(TEMPERATURES),
            CoTeDeTukey53H.computeTukey53H(TEMPERATURES, true),
            CoTeDeRateOfChange.computeRateOfChange(
                TEMPERATURES
            ),
            CoTeDeWoaNormbias.computeNormbias(
                LATITUDE,
                LONGITUDE,
                TEMPERATURES,
                DEPTHS,
                TIMESTAMP,
                woaParameters
            ).stream().map(WoaNormbias::getValue).mapToDouble(v -> v).toArray(),
            CoTeDeCarsNormbias.computeNormbias(
                LATITUDE, LONGITUDE, TEMPERATURES, DEPTHS, carsParameters
            ).stream().mapToDouble(v -> v).toArray(),
            CoTeDeAnomalyDetection.processConstantClusterSize(TEMPERATURES)
        ),
        1e-1
    );
  }

  @Test
  void testComputeGradientProb() {
    assertArrayEquals(
        EXPECTED_GRADIENT_PROB,
        CoTeDeAnomalyDetection.processGradient(
            CoTeDeGradient.computeGradient(TEMPERATURES)
        ),
        1e-14
    );
  }

  @Test
  void testComputeSpikeProb() {
    assertArrayEquals(
        EXPECTED_SPIKE_PROB,
        CoTeDeAnomalyDetection.processSpike(
            CoTeDeSpike.computeSpikes(TEMPERATURES)
        ),
        1e-14
    );
  }

  @Test
  void testComputeTukeyNormProb() {
    assertArrayEquals(
        EXPECTED_TUKEY_PROB,
        CoTeDeAnomalyDetection.processTukeyNorm(
            CoTeDeTukey53H.computeTukey53H(TEMPERATURES, true)
        ),
        1e-14
    );
  }

  @Test
  void testComputeRateOfChangeProb() {
    assertArrayEquals(
        EXPECTED_RATE_OF_CHANGE_PROB,
        CoTeDeAnomalyDetection.processRateOfChange(
            CoTeDeRateOfChange.computeRateOfChange(
                TEMPERATURES
            )
        ),
        1e-14
    );
  }

  @Test
  void testComputeWoaNormBiasProb() throws InvalidRangeException, IOException {
    assertArrayEquals(
        EXPECTED_WOA_NORM_BIAS_PROB,
        CoTeDeAnomalyDetection.processWoaNormBias(
            CoTeDeWoaNormbias.computeNormbias(LATITUDE, LONGITUDE, TEMPERATURES, DEPTHS, TIMESTAMP, woaParameters).stream()
                .map(WoaNormbias::getValue)
                .mapToDouble(v -> v)
                .toArray()
        )
    );
  }

  @Test
  void testComputeCarsNormBiasProb() throws InvalidRangeException, IOException {
    assertArrayEquals(
        EXPECTED_CARS_NORM_BIAS_PROB,
        CoTeDeAnomalyDetection.processCarsNormBias(
            CoTeDeCarsNormbias.computeNormbias(
                LATITUDE, LONGITUDE, TEMPERATURES, DEPTHS, carsParameters
            ).stream().mapToDouble(v -> v).toArray()
        )
    );
  }

  @Test
  void testComputeConstantClusterSizeProb() {
    assertArrayEquals(
        EXPECTED_CONSTANT_CLUSTER_SIZE_PROB,
        CoTeDeAnomalyDetection.processConstantClusterSize(
            Arrays.stream(ConstantClusterSize.computeClusterSizes(TEMPERATURES, 0.0D))
                .mapToDouble(v -> v)
                .toArray()
        )
    );
  }

  @Test
  void testExpectedFlags() throws InvalidRangeException, IOException {
    assertArrayEquals(
        new int[]{11},
        CoTeDeAnomalyDetection.getFlags(
            CoTeDeGradient.computeGradient(TEMPERATURES),
            CoTeDeSpike.computeSpikes(TEMPERATURES),
            CoTeDeTukey53H.computeTukey53H(TEMPERATURES, true),
            CoTeDeRateOfChange.computeRateOfChange(
                TEMPERATURES
            ),
            CoTeDeWoaNormbias.computeNormbias(LATITUDE, LONGITUDE, TEMPERATURES, DEPTHS, TIMESTAMP, woaParameters).stream()
                .map(WoaNormbias::getValue)
                .mapToDouble(v -> v)
                .toArray(),
            CoTeDeCarsNormbias.computeNormbias(
                LATITUDE, LONGITUDE, TEMPERATURES, DEPTHS, carsParameters
            ).stream().mapToDouble(v -> v).toArray(),
            Arrays.stream(ConstantClusterSize.computeClusterSizes(TEMPERATURES, 0.0D))
                .asDoubleStream().toArray(),
            -16
        )
    );
  }

